SEED_PATH= "input_data/cc-seed-data.json"
FORMAT_CSV = 1
FORMAT_PSV = 2
FORMAT_JSON = 4
FORMAT_SQLITE = 8

FORMATS={"csv":FORMAT_CSV,"psv":FORMAT_PSV,"json":FORMAT_JSON,"sqlite":FORMAT_SQLITE}
TESTM=(-1,-1,-1)

def Main():
    n,f,p=ParseArgs()
    if None in (n,f,p):
        PrintUsage()
    elif (n,f,p)==TESTM:
        RunTestMode()
    else:
        if n > 0:
            GenerateFakeRecords(n, f, p)
            print("\n [+]  Mission complete\n [+] ",n,"fake records created,",argv[2],"format, saved as",p,"\n")
        else:
            print("n-records is less than or equal to 0.  no action taken.")
def RunTestMode():
    args = [[10, FORMATS.get(k), "test.{}".format(k)] for k in FORMATS.keys()]
    for n, f,p in args:
        print("Creating",n,"fake records using format",{v:k for k,v in FORMATS.items()}.get(f),"and saving to",p,"\n")
        GenerateFakeRecords(n, f, p)

def GenerateFakeRecords(n,f,p):
    gen = RecordGenerator(SEED_PATH)
    r1 = gen.MakeRecords(n,f)
    WriteRecords(r1,f,p,schema=gen.GetSchema())

def PrintUsage():
    print("\n\n    Incorrect syntax.\n        Usage:\n        ", argv[0], " [n-records] [format] [outfile-name]")
    print("\n    [n-records]={int}                  The number of fake records to create, as an integer")
    print("    [format]={csv|psv|json|sqlite}     The file format to write")
    print("    [outfile-name]={path}              The file name to write to")
    print("\n\n    Example to generate 1000 sqlite3 records and save as db.sqlite:\n\n        ", argv[0], " 1000 sqlite db.sqlite")
    print()

def ParseArgs():
    n=None
    p=None
    f=None
    if len(argv) == 2 and argv[1]=="TESTMODE":
        print("\n***running test mode... creating one file of each format type using n-records=10 and filename=test.{format}***\n")
        n,f,p=TESTM
    elif len(argv)==4:
        try:
            n=int(argv[1])
        except:
            print("\n***unable to parse \"",argv[1],"\" as an integer***\n")
        try:
            f=FORMATS[argv[2].lower()]
        except:
            print("\n***unable to understand format \"",argv[2],"\" ... arg must be one of the following: csv, psv, json, sqlite***\n")
        try:
            with open(argv[3],"w") as fz:
                fz.close()
            osremove(argv[3])
            p=argv[3]
        except:
            print("\n***unable to open or create a file using path \"",argv[3],"\" ***\n")
    return (n,f,p)





def writecsv(gen_result,path,schema):
    with open(path,"w",newline="") as f:
        fields=schema
        writer=DictWriter(f,fieldnames=fields,delimiter=",",quoting=QUOTE_NONE,skipinitialspace=False)
        writer.writeheader()
        writer.writerows([x._asdict() for x in gen_result])

def writepsv(gen_result,path,schema):
    with open(path,"w",newline="") as f:
        fields=schema
        writer=DictWriter(f,fieldnames=fields,delimiter="|",quoting=QUOTE_NONE,skipinitialspace=True)
        writer.writeheader()
        writer.writerows([x._asdict() for x in gen_result])

def writejson(gen_result,path,schema=None):
    with open(path, "w",newline="\n") as f:
        j={"SutterRecords":[x._asdict() for x in gen_result]}
        dump(j,f,indent=4,sort_keys=False)

def writesqlite(gen_result,path,schema):
    if ospath.exists(path):
        osremove(path)
    con = connect(path)
    cur = con.cursor()
    col_names=str(schema)[1:-1]
    cur.execute("CREATE TABLE CreditCartRecords ({});".format(col_names))  # use your column names here
    cur.executemany("INSERT INTO CreditCartRecords ({}) VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?);".format(col_names), gen_result)
    con.commit()
    con.close()


def WriteRecords( data, format, path,  schema=None):
    writef = {
        FORMAT_CSV: writecsv,
        FORMAT_PSV: writepsv,
        FORMAT_JSON: writejson,
        FORMAT_SQLITE: writesqlite
    }
    for i in [FORMAT_CSV, FORMAT_PSV,  FORMAT_JSON, FORMAT_SQLITE]:
        if (i & format):
            writef[i](data,path,schema)



